import Logo from "./asset/logo.png";
import NestedList1 from "./NestedList1";
const Sidebar = () => {
  return (
    <div className="sidebar">
      <div>
        <img src={Logo} alt="logo"></img>
        <p>西西の筆記</p>
      </div>
      <div>
        <NestedList1 />
      </div>
    </div>
  );
};

export default Sidebar;
